import Navbar_Routes from "../Data/Navbar_Routes"

export default function Navbar () {
    return (
        <nav>
            <ul>
            {Navbar_Routes.map((menu,index)=>{
                return (<li>{menu}</li>)
            })}
            </ul>
        </nav>
    )
}
